  const { isMenu, setIsMenu } = props;
  console.log(isMenu);

  function handleClick_2() {
    setIsMenu(false);
  }
  if (isMenu == true) {
    return (
      <del>
        <div
          onClick={() => {
            handleClick_2();
          }}
          className="menu"
        >
          <img className="like" src={like} />
        </div>
        <div>
          <img src={delete1} />
        </div>
      </del>
    );
  }
}

export default Menu;
